import {OperationResult, PopupContainer, Preloader, PreloaderText} from "./PopupStyled";
import React, {useState} from "react";

interface PopupProps {
    popupFlag: boolean,
    message: string,
    operationResult: boolean | string
}

const Popup = (props:PopupProps) => {

    console.log(props.operationResult)
    return(
        <PopupContainer visible={props.popupFlag} result={props.operationResult}>
            <OperationResult>
                <Preloader/>

                <PreloaderText>{props.message}</PreloaderText>
            </OperationResult>
        </PopupContainer>
    )
}

export default Popup
